import React from "react";
import { Link } from "react-router-dom";
import "./style.css";

function Navbar() {
    return (

        <nav className="navbar navbar-expand-lg ">
            <div className="container-fluid">
                <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarNav">
                    <ul className="navbar-nav">
                        <Link  to="/" className={window.location.pathname === "/" ? "nav-link active" : "nav-link"}>Home</Link>
                        <Link  to="/About" className={window.location.pathname === "/About" ? "nav-link active" : "nav-link"}>About</Link>
                        <Link  to="/Portfolio" className={window.location.pathname === "/Portfolio" ? "nav-link active" : "nav-link"}>Portfolio</Link>
                        <Link  to="/Contact" className={window.location.pathname === "/Contact" ? "nav-link active" : "nav-link"}>Contact</Link>
                    </ul>
                </div>
            </div>
        </nav>
    );

}

export default Navbar;
